import Dashboard from "../components/Layout/Dashboard";
import Navbar from "../components/Navbar/Navar";
import { Row, Col, Divider } from 'antd';
class Index extends React.Component {
  static getInitialProps({ store }) {}
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <main className="index">
      <Row gutter={16}>
      <Col className="gutter-row" span={6}>
        <div >The AAP leader’s tweet came a day after Adityanath launched a scathing attack at him in his address in state Assembly. Without naming Singh, the chief minister said, “Some ‘namoonas’ come here and ask us what we have done for the people of the state? They want to talk about the situation in UP, but steer clear of talking about the condition of Delhi.”

