Adityanath also presented data to and compared the Covid-19 situation in Uttar Pradesh with that of Delhi. He highlighted that the fatality rate in Uttar Pradesh is much lower than Delhi.</div>
      </Col>
      <Col className="gutter-row" span={6}>
        <div >col-6</div>
      </Col>
      <Col className="gutter-row" span={6}>
        <div >col-6</div>
      </Col>
      <Col className="gutter-row" span={6}>
        <div >col-6</div>
      </Col>
    </Row>
    </main>
    );
  }
}

const mapStateToProps = (state) => ({
  counter: state.counter.value,
});

const mapDispatchToProps = {
  incrementCounter: incrementCounter,
  decrementCounter: decrementCounter,
};
Index.getInitialProps = authInitialProps();

